function initCustomTabs(){document.querySelectorAll(".custom-tabs-bar").forEach((t=>{const e=t.querySelectorAll(".custom-tabs-btn");e.forEach((t=>{t.addEventListener("click",(()=>handleTabClick(t)))})),e.length>0&&handleTabClick(e[0])}))}function handleTabClick(t){const e=t.parentElement.querySelectorAll(".custom-tabs-btn"),a=t.getAttribute("aria-custom-tabs-tab"),c=document.getElementById(a);e.forEach((t=>{t.classList.remove("custom-tabs-btn-active");const e=t.getAttribute("aria-custom-tabs-tab"),a=document.getElementById(e);a&&(a.style.display="none")})),t.classList.add("custom-tabs-btn-active"),c&&(c.style.display="block")}document.addEventListener("DOMContentLoaded",(function(){for(el of document.querySelectorAll("[ctc]"))el.title="Click to copy",el.addEventListener("click",(t=>{t.preventDefault(),navigator.clipboard.writeText(t.target.innerText)}));initCustomTabs()}),!1);